import { Link } from "react-router-dom";

const Header = () => {
    return (
        <header className="header">

            <div className="container">
                <div className="logo-wrapper">
                    <div className="logo">
                        <Link to="/projects">project</Link>
                        <span></span>
                    </div>
                    <Link to="/thoughts">Blog</Link>
                </div>
            </div>
        </header>
    );
};

export default Header;
